import React from 'react';
import { Route } from 'react-router-dom';
import Beer from '../components/Beer';
import GetData from '../components/GetData';

function BeerwithData(props) {
  return (
    <GetData father={props}>{(beer) => <Beer beer={beer}></Beer>}</GetData>
  );
}

function App() {
  return (
    <div className="App">
      <Route
        path="/:id"
        component={() => (
          <GetData>{(beer) => <Beer beer={beer}></Beer>}</GetData>
        )}
      />
    </div>
  );
}

export default App;
